DROP DATABASE IF EXISTS languages_courses;
CREATE DATABASE languages_courses;

USE languages_courses;

SET FOREIGN_KEY_CHECKS=0;
DROP TABLE IF EXISTS `books`;
CREATE TABLE `books` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `author` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `description` text COLLATE utf8_unicode_ci NOT NULL,
  `language` enum('ENGLISH','DEUTCH') COLLATE utf8_unicode_ci DEFAULT NULL,
  `date` date NOT NULL,
  `level` enum('A1','A2','B1','B2','C1','C2') COLLATE utf8_unicode_ci DEFAULT NULL,
  `genre` varchar(10) COLLATE utf8_unicode_ci NOT NULL,
  `accent` enum('GB','USA','AUS') COLLATE utf8_unicode_ci DEFAULT NULL,
  `body` text COLLATE utf8_unicode_ci NOT NULL,
  `count_words` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `name` (`name`),
  KEY `author` (`author`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



DROP TABLE IF EXISTS `courses`;
CREATE TABLE `courses` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `description` text COLLATE utf8_unicode_ci NOT NULL,
  `level` enum('A1','A2','B1','B2','C1','C2') COLLATE utf8_unicode_ci DEFAULT NULL,
  `language` enum('DEUTCH','ENGLISH') COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `name` (`name`,`level`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



DROP TABLE IF EXISTS `mailing_lists`;
CREATE TABLE `mailing_lists` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `author` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `description` text COLLATE utf8_unicode_ci NOT NULL,
  `language` enum('ENGLISH','DEUTCH') COLLATE utf8_unicode_ci DEFAULT NULL,
  `date` date NOT NULL,
  `categories` varchar(10) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`),
  KEY `author` (`author`),
  KEY `categories` (`categories`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



DROP TABLE IF EXISTS `songs`;
CREATE TABLE `songs` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `author` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `description` text COLLATE utf8_unicode_ci NOT NULL,
  `language` enum('ENGLISH','DEUTCH') COLLATE utf8_unicode_ci DEFAULT NULL,
  `date` date NOT NULL,
  `level` enum('A1','A2','B1','B2','C1','C2') COLLATE utf8_unicode_ci DEFAULT NULL,
  `genre` varchar(10) COLLATE utf8_unicode_ci NOT NULL,
  `accent` enum('GB','USA','AUS') COLLATE utf8_unicode_ci DEFAULT NULL,
  `count_words` int(11) NOT NULL,
  `body` longblob NOT NULL,
  `size` int(11) NOT NULL,
  `metadata` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL CHECK (json_valid(`metadata`)),
  `media_type` varchar(10) COLLATE utf8_unicode_ci NOT NULL,
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `name` (`name`),
  KEY `author` (`author`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `firstname` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `lastname` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `email` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `phone` bigint(20) NOT NULL,
  `birthday` date DEFAULT NULL,
  `language` enum('RUSSIAN','ENGLISH','DEUTCH') COLLATE utf8_unicode_ci DEFAULT NULL,
  `password` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `email` (`email`),
  UNIQUE KEY `phone` (`phone`),
  KEY `email_2` (`email`),
  KEY `firstname` (`firstname`,`lastname`)
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



DROP TABLE IF EXISTS `users_books`;
CREATE TABLE `users_books` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) unsigned NOT NULL,
  `books_id` bigint(20) unsigned NOT NULL,
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  KEY `books_id` (`books_id`),
  CONSTRAINT `users_books_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`),
  CONSTRAINT `users_books_ibfk_2` FOREIGN KEY (`books_id`) REFERENCES `books` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



DROP TABLE IF EXISTS `users_courses`;
CREATE TABLE `users_courses` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) unsigned NOT NULL,
  `courses_id` bigint(20) unsigned NOT NULL,
  `users_start_date` date NOT NULL,
  `users_end_date` date DEFAULT NULL,
  `users_grade` INT unsigned DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`,`courses_id`),
  KEY `courses_id` (`courses_id`),
  CONSTRAINT `users_courses_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`),
  CONSTRAINT `users_courses_ibfk_2` FOREIGN KEY (`courses_id`) REFERENCES `courses` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



DROP TABLE IF EXISTS `users_mailing_lists`;
CREATE TABLE `users_mailing_lists` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) unsigned NOT NULL,
  `mailing_lists_id` bigint(20) unsigned NOT NULL,
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  KEY `mailing_lists_id` (`mailing_lists_id`),
  CONSTRAINT `users_mailing_lists_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`),
  CONSTRAINT `users_mailing_lists_ibfk_2` FOREIGN KEY (`mailing_lists_id`) REFERENCES `mailing_lists` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



DROP TABLE IF EXISTS `users_songs`;
CREATE TABLE `users_songs` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) unsigned NOT NULL,
  `songs_id` bigint(20) unsigned NOT NULL,
  `users_count_words` int(11) NOT NULL,
  `users_start_date` date NOT NULL,
  `users_end_date` date DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  KEY `songs_id` (`songs_id`),
  CONSTRAINT `users_songs_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`),
  CONSTRAINT `users_songs_ibfk_2` FOREIGN KEY (`songs_id`) REFERENCES `songs` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



DROP TABLE IF EXISTS `users_video_puzzle`;
CREATE TABLE `users_video_puzzle` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) unsigned NOT NULL,
  `video_puzzle_id` bigint(20) unsigned NOT NULL,
  `users_count_words` int(11) NOT NULL,
  `users_start_date` date NOT NULL,
  `users_end_date` date DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  KEY `video_puzzle_id` (`video_puzzle_id`),
  CONSTRAINT `users_video_puzzle_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`),
  CONSTRAINT `users_video_puzzle_ibfk_2` FOREIGN KEY (`video_puzzle_id`) REFERENCES `video_puzzle` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



DROP TABLE IF EXISTS `video_puzzle`;
CREATE TABLE `video_puzzle` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `author` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `description` text COLLATE utf8_unicode_ci NOT NULL,
  `language` enum('ENGLISH','DEUTCH') COLLATE utf8_unicode_ci DEFAULT NULL,
  `date` date NOT NULL,
  `level` enum('A1','A2','B1','B2','C1','C2') COLLATE utf8_unicode_ci DEFAULT NULL,
  `genre` varchar(10) COLLATE utf8_unicode_ci NOT NULL,
  `accent` enum('GB','USA','AUS') COLLATE utf8_unicode_ci DEFAULT NULL,
  `count_words` int(11) NOT NULL,
  `subtutles` text COLLATE utf8_unicode_ci NOT NULL,
  `body` longblob NOT NULL,
  `size` int(11) NOT NULL,
  `metadata` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL CHECK (json_valid(`metadata`)),
  `media_type` varchar(10) COLLATE utf8_unicode_ci NOT NULL,
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `name` (`name`),
  KEY `author` (`author`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


SET FOREIGN_KEY_CHECKS=1;



